/**
 * @type {Function} SearchController
 * @param {HTMLElement} Form
 * @param {HTMLElement} Output
 *
 * Manages the searchbar, filtering, and everything related to the search fundamentals.
 */
function SearchController(form, output) {
  return {
    form: form,
    output: output,
    counter: form.querySelector('#searchCounter'),
    goToPages: form.querySelector('#goToPages'),
    excludes: [],
    init: function() {
      let self = this;
      // Create listener, define children within form, etc.
      let FilterExcludeElements = this.form.querySelectorAll('input[type="checkbox"]');
      let SearchBar = this.form.querySelector('#searchInput');
      let goBack = this.form.querySelector('#goBackPage');
      let goNext = this.form.querySelector('#goNextPage');

      // Fetch initial exclude-filters from URL
      if (!!getQuery(window.location.search)['exclude']) {
        let excludesArray = excludeFilters(getQuery(window.location.search)['exclude']);
        for (let i = 0; i < FilterExcludeElements.length; i++) {
          this.excludes[FilterExcludeElements[i].name] = true;
          FilterExcludeElements[i].checked = true;
          for (let j = 0; j < excludesArray.length; j++) {
            if (excludesArray[j] === FilterExcludeElements[i].name) {
              this.excludes[FilterExcludeElements[i].name] = false;
              FilterExcludeElements[i].checked = false;
            }
          }
        }
      } else {
        for (let i = 0; i < FilterExcludeElements.length; i++) {
          this.excludes[FilterExcludeElements[i].name] = true;
          FilterExcludeElements[i].checked = true;
        }
      }

      // Search if search query is set
      if (!!getQuery(window.location.search)['query']) {
        SearchBar.value = getQuery(window.location.search)['query'];
        self.search(getQuery(window.location.search)['query']);
      }


      // Listen for exclude-filter change
      for (let i = 0; i < FilterExcludeElements.length; i++) {
        FilterExcludeElements[i].addEventListener('change', function() {
          self.excludes[FilterExcludeElements[i].name] = FilterExcludeElements[i].checked;
          console.log(allIsFalse(self.excludes));
          let excludesParameter = changeParam('exclude', setExcludes(self.excludes));
          let fullUrl = window.location.origin + window.location.pathname + excludesParameter;
          window.history.pushState(null, 'Search', fullUrl);
          self.search(getQuery(window.location.search)['query']); // Uncomment if instant-search is desired
        });
      }

      // Listen for form submit
      this.form.addEventListener('submit', function(e) {
        e.preventDefault();
        let excludesParameter = changeParam('query', encodeURI(SearchBar.value));
        let fullUrl = window.location.origin + window.location.pathname + excludesParameter;
        window.history.pushState(null, 'Search', fullUrl);
        self.search(SearchBar.value);
      });

      // Listen for page navigation click
      goNext.addEventListener('click', function() {
        // go next
        Pagination.goToPage(Pagination.page+1, (data) => {
          if (!data.error) {
            self.highlightActivePage();
            self.counter.innerHTML = 'Side ' + data.page + ' av ' + data.pages;
            self.output.innerHTML = "";
            for(let i = 0; i < data.data.length; i++) {
              self.output.appendChild(Article(data.data[i]).toResult());
            }
          }
        });
      });
      goBack.addEventListener('click', function() {
        // go next
        Pagination.goToPage(Pagination.page-1, (data) => {
          if (!data.error) {
            self.highlightActivePage();
            self.counter.innerHTML = 'Side ' + data.page + ' av ' + data.pages;
            self.output.innerHTML = "";
            for (let i = 0; i < data.data.length; i++) {
              self.output.appendChild(Article(data.data[i]).toResult());
            }
          }
        });
      });
    },
    search: function(query) {
      let self = this;
      query = query.trim();
      if (!!query) {
        if (!allIsFalse(self.excludes)) {
          this.output.innerHTML = "<p class='text--loading'><img src='data:image/gif;base64,'/></p>";
          ApiManager.init().read(str2query(query, this.excludes), function(response) {
            let dataPageHandled = Pagination.init(response);
            self.output.innerHTML = "";
            //console.log(response);
            if (dataPageHandled.data.length > 0) {

              // Handle pages
              self.counter.innerHTML = 'Side ' + dataPageHandled.page + ' av ' + dataPageHandled.pages;
              // Print pages buttons
              self.goToPages.innerHTML = "";
              if (dataPageHandled.pages > 1) {
                for(let i = 1; i <= dataPageHandled.pages; i++) {
                  // Generate page item
                  let pageItem = document.createElement('a');
                  pageItem.setAttribute('class', 'pageItem');
                  pageItem.innerHTML = i;
                  pageItem.href = changeParam('page', i);
                  // Add eventlistener for clicking
                  pageItem.addEventListener('click', function(e) {
                    e.preventDefault();
                    Pagination.goToPage(i, function(data) {
                      if(!data.error) {
                        self.counter.innerHTML = 'Side ' + data.page + ' av ' + data.pages;
                        self.output.innerHTML = "";
                        for(let j = 0; j < data.data.length; j++) {
                          self.output.appendChild(Article(data.data[j]).toResult());
                        }
                      }
                      self.highlightActivePage();
                    });
                  });
                  self.goToPages.appendChild(pageItem);
                }
                self.highlightActivePage();
              }
                for(let i = 0; i < dataPageHandled.data.length; i++) {
                  self.output.appendChild(Article(dataPageHandled.data[i]).toResult());
                }
            } else {
              self.goToPages.innerHTML = "";
              self.counter.innerHTML = "";
              self.output.innerHTML = "<p id='noContentMessage'>Ingen resultater...</p>";
            }
          });
        }
      }
    },
    highlightActivePage: function() {
      let allPageItems = self.goToPages.getElementsByClassName('pageItem');
      // Unset all active page highlights
      for (let k = 0; k < allPageItems.length; k++) {
        if ('pageItem activePage' === allPageItems[k].getAttribute('class')) {
          allPageItems[k].setAttribute('class', 'pageItem');
        }
      }
      // Set active page highlight
      let activePage = getQuery(window.location.search)['page'] || 1;
      allPageItems[activePage - 1].setAttribute('class', 'pageItem activePage');
    }
  }
}